import React, { useState, useRef } from "react";import "./App.css";
import pic1 from "./assets/RecipeScreenshot.webp";
import profile from "./assets/RODRIGUEZ_KENLEY.jpg";
import { Button, Carousel } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  const [currentPage, setCurrentPage] = useState("about");
  const [currentSection, setCurrentSection] = useState(0);
  const sectionsRef = useRef([]);

  const handlePageChange = (page) => {
    setCurrentPage(page);
  };

  const handleClick = (index) => {
    setCurrentSection(index);
    const sectionElement = sectionsRef.current[index];
    sectionElement.scrollIntoView({ behavior: "smooth", block: "start" });
  };

  return (
    <div className="Container">
      <div
        style={{ display: "flex", flexDirection: "column", height: "100vh" }}
      >
        <div style={{ display: "flex", height: '100%' }}>
          <div
            style={{
              width: "50%",
              padding: "1rem",
              alignContent: "center",
              alignSelf: "center",
              justifyContent: "center",
            }}
          >
            <h1>Hi! My name is Kenley Rodriuez</h1>
            <p>
              I'm a full-stack developer with a passion for building scalable
              and user-friendly web applications. I have experience using
              technologies such as React.js, Node.js, and MongoDB.
            </p>
          </div>
          <img
            style={{
              width: "50%",
              height: "100%",
              backgroundImage: "url(./image.jpg)",
              backgroundPosition: "center",
            }}
            src={profile}
            className="App-logo"
            alt="profile"
          />
        </div>
      </div>
      {/* <header className="App-header">
        <img src={profile} className="App-logo" alt="profile" />
        <nav className="Nav-bar">
          <button
            onClick={() => handlePageChange("about")}
            className="Nav-bar-button"
          >
            About
          </button>
          <button
            onClick={() => handlePageChange("projects")}
            className="Nav-bar-button"
          >
            Projects
          </button>
          <button
            onClick={() => handlePageChange("contact")}
            className="Nav-bar-button"
          >
            Contact
          </button>
        </nav>
      </header> */}

      <main className="Main" ref={(el) => (sectionsRef.current[0] = el)}>
        <h2
          style={{ margin: "0 0 20px 0", fontWeight: "bold", color: "white" }}
        >
          Projects
        </h2>
        {currentPage === "about" && (
          <Carousel style={{ padding: 10, paddingHo }}>
            <Carousel.Item>
              <img
                style={{ height: "90vh", paddingBottom: 100 }}
                src={pic1}
                alt="profile"
              />
              <Carousel.Caption>
                <h3>MeChef</h3>
                <p>
                  Application that uses recipe api to return dishes related to
                  the ingredients that you have in your pantry
                </p>
              </Carousel.Caption>
            </Carousel.Item>

            {/* <Carousel.Item>
              <img style={{ height: "50vh" }} src={profile} alt="profile" />
              <Carousel.Caption>
                <h3>About Me</h3>
                <p>A little about myself</p>
              </Carousel.Caption>
            </Carousel.Item> */}
          </Carousel>
        )}

        {currentPage === "projects" && (
          <section className="Projects-section">
            <h2>Projects</h2>
            <ul>
              <li>Project 1</li>
              <li>Project 2</li>
              <li>Project 3</li>
            </ul>
          </section>
        )}

        {currentPage === "contact" && (
          <section className="Contact-section">
            <h2>Contact</h2>
            <form className="Contact-form">
              <label htmlFor="name">Name:</label>
              <input type="text" id="name" name="name" />

              <label htmlFor="email">Email:</label>
              <input type="email" id="email" name="email" />

              <label htmlFor="message">Message:</label>
              <textarea id="message" name="message"></textarea>

              <button type="submit" className="Submit-button">
                Submit
              </button>
            </form>
          </section>
        )}
      </main>

      <div style={{ position: "fixed", top: '45%', right: 20, borderRadius: 10, display: "flex", flexDirection: 'column', justifyContent: "center", backgroundColor: "white", padding: "1rem" }}>
        {["Section 1", "Section 2", "Section 3"].map((section, index) => (
          <button
            key={section}
            style={{ margin: "0 1rem" }}
            onClick={() => handleClick(index)}
          >
            {section}
          </button>
        ))}
      </div>
    </div>
  );
}
export default App;
